import React, { Component } from 'react';

class ClaseDigital extends Component {

constructor ( props ) {
    super( props );
    this.state = {
        message: 'PERO DEBO CONECTARME A CLASSROOM'
    }
}

render () {
    return (
        <footer>
        <h1>{this.state.message}</h1>
        </footer>
    )
}
};

export default ClaseDigital;
